export default app=>{app.component("carousel-items",{props:{fields:{type:Array,required:true}},template:`<div v-for="field in fields" :key="field.id" class="carousel-item" :class="{ active: field.active }" :data-bs-interval="field.interval">\n        <img :src="field.imgsrc" class="d-block w-100" :alt="field.imgalt">\n        <figcaption class="carousel-caption d-none d-md-block">\n            <h5>{{ field.title }}</h5>\n            <p><slot name="text" :field="field">{{ field.text }}</slot></p>\n        </figcaption>\n    </div>`})};